import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import BlankWhitepage from './Homepage/HomePage';
import AppointmentHistory from './ApptHistory/apptHistory';
import Doctor from './DoctorPortal/Doctor';

// Define the App component
function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={BlankWhitepage} />
        <Route path="/apptHistory" component={AppointmentHistory} />
        <Route path="/Doctor" component={Doctor} />
      </Switch>
    </Router>
  );
}

// Render the App component into the DOM
ReactDOM.render(<App />, document.getElementById('root'));

// Export the App component
export default App;
